import './App.css';
import data from './data';

function App() {
  return (
    <div>
      <header>
        <a href="/">Pet Adopt</a>
      </header>
      <main>
        <h1>Animale disponibile</h1>
        <div className="products">
          {data.pets.map((pet) => (
            <div className="product" key={pet.slug}>
              <a href={`/pet/${pet.slug}`}>
                <img src={pet.photos} alt={pet.name} />
              </a>
              <div className="pet-info">
                <p>{pet.name}</p>
                <div className="pet-tags">
                  <p>{pet.age} ani</p>
                  <p>{pet.gender}</p>
                </div>
                <p>{pet.description}</p>
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
}

export default App;
